- input: "TEXT\x1CC00005561\x1CX0\x1C\x1CF3XA\x1CIn response to your letter dated
    August 19, 2008, The Committee has amended the 2007 October Monthly report to
    reflect the correct Column B totals for lines 21ai and 21aii.  The receipt total
    reflects the correct lower amount due to the fact that on the original report
    affiliated contributions were incorrectly listed as contributions instead of memo
    entries.  After verifying that the Committee was not missing a deposit, these
    entries were correctly listed as memo items and attached to the correct contribution.
    \   Please note that the salaries and related benefits listed on Schedule H4 were
    for employees who did not spend more than 25% of their time on federal election
    activity or in connection with a federal election.  The payment for Consulting/Accounting
    was not for federal election activity nor in connection with a federal candidate."
